var canvas = document.getElementById('canvas');
var context = canvas.getContext('2d');

var WIDTH = 800;
var HEIGHT = 600;
var ALPHA_THRESHOLD = 60;

canvas.width = WIDTH;
canvas.height = HEIGHT;

var canvasX;
var canvasY;
var isMouseDown = false;
var particles;
var imageData = context.createImageData(WIDTH, HEIGHT);

function updateCanvasCoordinates() {
    var rect = canvas.getBoundingClientRect();
    canvasX = rect.left;
    canvasY = rect.top;
}
updateCanvasCoordinates();
window.onresize = updateCanvasCoordinates;


function createParticles(context, xoffset, yoffset) {
    var w = context.canvas.width;
    var h = context.canvas.height;
    var imageData = context.getImageData(0, 0, w, h);
    var pixels = imageData.data;
    var particles = [], x, y;
    for (var i = 0; i < pixels.length; i += 4) {
        if (pixels[i + 3] > ALPHA_THRESHOLD) {
            var color = [
                pixels[i],
                pixels[i + 1],
                pixels[i + 2],
                pixels[i + 3]
            ];
            x = (i / 4) % imageData.width;
            y = (i / 4) / imageData.width | 0;
            particles.push({
                x: Math.random() * WIDTH,
                y: Math.random() * HEIGHT,
                sx: x + xoffset,
                sy: y + yoffset,
                fx: 0,
                fy: 0,
                vx: 0,
                vy: 0,
                color: color
            });
        }
    }
    return particles;
}

function init () {
    var canvas = document.createElement('canvas');
    var context = canvas.getContext('2d');
    var xoffset = (WIDTH - this.width) / 2;
    var yoffset = (HEIGHT - this.height) / 2;
    canvas.width = this.width;
    canvas.height = this.height;
    context.drawImage(this, 0, 0, this.width, this.height);
    particles = createParticles(context, xoffset, yoffset);
    initEvents();
    start();
}


var image = new Image();
image.crossOrigin = 'Anonymous';
image.onload = init;
// image.src = 'http://i.imgur.com/fdkXbv4.png'; // 256x256
image.src = 'data:image/svg+xml;base64,'; // 384x384
// image.src = 'http://i.imgur.com/KrJgbHs.png'; // 512x512






function start() {
    draw();
}

function update() {
    var p, dx, dy;
    for (var i = 0; i < particles.length; i++) {
        p = particles[i];
        dx = (p.sx - p.x);
        dy = (p.sy - p.y);
        p.vx = p.fx + dx * 0.04;
        p.vy = p.fy + dy * 0.04;
        p.x += p.vx;
        p.y += p.vy;
    }
}

function draw() {
    requestAnimationFrame(draw);
    var i, d = imageData.data;
    for (i = 3; i < d.length; i += 4) {
        d[i] = 0;
    }
    for (i = 0; i < particles.length; i++) {
        fillPixel(d, particles[i].x, particles[i].y, particles[i].color);
    }
    context.putImageData(imageData, 0, 0);
    update();
}

function fillPixel(data, x, y, color) {
    x = Math.round(x);
    y = Math.round(y);
    if (x < 0 || y < 0 || x >= WIDTH || y >= HEIGHT) {
        return;
    }
    var index = (y * WIDTH + x) * 4;
    data[index] = color[0];
    data[index + 1] = color[1];
    data[index + 2] = color[2];
    data[index + 3] = color[3];
}

function initEvents() {
    canvas.addEventListener('mouseover', function (event) {
        cursorForce(event);
        isMouseDown = true;
    });
    canvas.addEventListener('mousedown', function (event) {
        cursorForce(event);
        isMouseDown = true;
    });
    
    document.body.addEventListener('mousemove', function (event) {
        if (isMouseDown) {
            cursorForce(event);
            isMouseDown = true;
        }
    });
    
    document.body.addEventListener('mouseup', function () {
        clearForce();
        isMouseDown = false;
    });
}

function randomForce() {
    for (var i = 0; i < particles.length; i++) {
        particles[i].fx = (Math.random() - 0.5) * 15;
        particles[i].fy = (Math.random() - 0.5) * 15;
    }
}

function cursorForce(event) {
    var mx = event.pageX - canvasX;
    var my = event.pageY - canvasY;
    var p, dx, dy, d;
    for (var i = 0; i < particles.length; i++) {
        p = particles[i];
        dx = p.x - mx;
        dy = p.y - my;
        d = Math.sqrt(dx*dx + dy*dy);

        // randomize direction
        dx += (Math.random() - 0.5) * d * 1;
        dy += (Math.random() - 0.5) * d * 1;

        // Newton's magic
        d = d * d * d;
        p.fx = Math.min(50000 / d, 0.3) * dx;
        p.fy = Math.min(50000 / d, 0.3) * dy;
    }
}

function clearForce() {
    for (var i = 0; i < particles.length; i++) {
        particles[i].fx = particles[i].fy = 0;
    }
}


function changeColInUri(data,colfrom,colto) {
    // create fake image to calculate height / width
    var img = document.createElement("img");
    img.src = data;
    img.style.visibility = "hidden";
    document.body.appendChild(img);

    var canvas = document.createElement("canvas");
    canvas.width = img.offsetWidth;
    canvas.height = img.offsetHeight;

    var ctx = canvas.getContext("2d");
    ctx.drawImage(img,0,0);

    // remove image
    img.parentNode.removeChild(img);

    // do actual color replacement
    var imageData = ctx.getImageData(0,0,canvas.width,canvas.height);
    var data = imageData.data;

    var rgbfrom = hexToRGB(colfrom);
    var rgbto = hexToRGB(colto);

    var r,g,b;
    for(var x = 0, len = data.length; x < len; x+=4) {
        r = data[x];
        g = data[x+1];
        b = data[x+2];

        if((r == rgbfrom.r) &&
           (g == rgbfrom.g) &&
           (b == rgbfrom.b)) {

            data[x] = rgbto.r;
            data[x+1] = rgbto.g;
            data[x+2] = rgbto.b;

        } 
    }

    ctx.putImageData(imageData,0,0);

    return canvas.toDataURL();
}

function hexToRGB(hexStr) {
    var col = {};
    col.r = parseInt(hexStr.substr(1,2),16);
    col.g = parseInt(hexStr.substr(3,2),16);
    col.b = parseInt(hexStr.substr(5,2),16);
    return col;
}

